CREATE DEFINER=`root`@`localhost` PROCEDURE `isiDataTime` (IN `waktuMulai` DATE, IN `waktuSelesai` DATE, IN `hariPasarPertama` ENUM('legi','pahing','pon','wage','kliwon'))   BEGIN
    DECLARE hariPasarSaatIni ENUM('legi', 'pahing', 'pon', 'wage', 'kliwon') DEFAULT hariPasarPertama;

    mulaiLoop: LOOP
        -- Masukkan data ke tabel time
        VALUES (
            YEAR(waktuMulai),
            MONTH(waktuMulai),
            DAY(waktuMulai),
            waktuMulai,
            DAYNAME(waktuMulai),
            CASE DAYOFWEEK(waktuMulai)
                WHEN 1 THEN 'Minggu'
                WHEN 2 THEN 'Senin'
                WHEN 3 THEN 'Selasa'
                WHEN 4 THEN 'Rabu'
                WHEN 5 THEN 'Kamis'
                WHEN 6 THEN 'Jumat'
                WHEN 7 THEN 'Sabtu'
            END,
            hariPasarSaatIni
        );

        -- Tambah waktuMulai dengan satu hari
        SET waktuMulai = DATE_ADD(waktuMulai, INTERVAL 1 DAY);

        -- Perbarui hari pasar
        SET hariPasarSaatIni = CASE
            WHEN hariPasarSaatIni = 'legi' THEN 'pahing'
            WHEN hariPasarSaatIni = 'pahing' THEN 'pon'
            WHEN hariPasarSaatIni = 'pon' THEN 'wage'
            WHEN hariPasarSaatIni = 'wage' THEN 'kliwon'
            WHEN hariPasarSaatIni = 'kliwon' THEN 'legi'
        END;

        -- Periksa apakah loop harus berhenti
        IF waktuMulai > waktuSelesai THEN
            LEAVE mulaiLoop;
        END IF;
    END LOOP mulaiLoop;
END$$

